import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className='navbar'>
            <Link className='txt' to="/">Library</Link>
            <Link className='txt' to="/reservations">Reservations</Link>
        </nav>
    );
}

export default Navbar;
